function Post() {

    return (
       <ReactMarkdown>  
        # THIS IS A POST 


        here is a bunch of text for the post. this is in markdown
        right there in react. very cool! super dope!  


        <br/>
        another paragragh.


        **italics** 


        ***bold***

       </ReactMarkdown>
    )
}

export default Post;
